<script setup>
import {onMounted, ref} from "vue";

const loadText = ref("")

onMounted(() => {
  setInterval(() => {
    if (loadText.value.length > 5) {
      loadText.value = ''
    }
    loadText.value += '.'

  }, 1000)
})
</script>

<template>
  <div class="load-gif">
    <div class="img-item">
      <img
          src="data:image/gif;base64,"/>
    </div>
    <div class="text-item">
      {{ "loading " + loadText }}
    </div>
  </div>
</template>

